import React from 'react'
import { SliderData } from './SliderData'

const ImageSlider = () => {
    return (
        <div>
            {SliderData.map((slide, index) => {
                return 
                    <img src={slide.image} alt="image of project" />;

            })}
        </div>
    )
}

export default ImageSlider
